function setInputVal(k){k.blockStr.str=k.task.info.alg_answer||k.ds;k.blockStr.str=k.blockStr.str.replace(/[^0-9]/g,"0");if(k.n==8){k.blockStr.str=k.blockStr.str.length!=8?k.ds:k.blockStr.str;if(k.blockStr.str.substring(0,4)<minYear||k.blockStr.str.substring(0,4)>maxYear||k.blockStr.str.substring(4,6)>12||k.blockStr.str.substring(6,8)>31){console.log("结果不是日期格式");k.blockStr.str=k.today}}else{var l=k.n-k.blockStr.str.length,i="";if(l>0){for(var j=0;j<l;j++){i+="0"}k.blockStr.str=i+k.blockStr.str}else{k.blockStr.str=k.blockStr.str}}var h=$("#codeLockWrap input.ansNum");var f;for(var j=0;j<k.n;j++){h[j].value=k.blockStr.str[j];h[j].onfocus=function(){f=this.value;this.value=""};h[j].onblur=function(){if(!this.value){this.value=f}};h[j].onkeyup=function(){this.blur()}}}getCurStr=function(){var h=[];var f=$("#codeLockWrap input.ansNum");for(var e=0,g=f.length;e<g;e++){h[e]=f[e].value}return h.join("")};